    <NoteNode id="287">
      <children id="288"/>
      <location class="Point2D.Double" id="289" x="210.0" y="920.0"/>
      <id id="290" value="91d086d2-2ee3-4e87-8bf7-a993f50105ea"/>
      <revision>1</revision>
      <backgroundColor class="javax.swing.plaf.ColorUIResource" reference="9"/>
      <borderColor class="javax.swing.plaf.ColorUIResource" reference="10"/>
      <textColor class="javax.swing.plaf.ColorUIResource" reference="10"/>
      <text id="291" justification="0" size="4" underlined="false">
        <text>Usage of this api would be as follows;
Create a class &lt;b&gt;YourTest&lt;/b&gt; 
&lt;/b&gt;
NOTES: 
The &lt;b&gt;YourTest&lt;/b&gt; names will never be plural.
The &lt;b&gt;YourTest&lt;/b&gt; would extend one of;
&lt;b&gt;FunctionalTest, PackageTest or ClassTest&lt;/b&gt;
&lt;/b&gt;
The &lt;b&gt;YourTest&lt;/b&gt; class must then have;
1) a respective &lt;b&gt;TestScope&lt;/b&gt; annotation
2) A no argument constructor.
3) at least one method with the &lt;b&gt;@Exhibit&lt;/b&gt; Annotation
ie;
&lt;b&gt;@Exhibit&lt;/b&gt;
public void exhibitOrderFoodSuccess() {}
&lt;/b&gt;
The &lt;b&gt;YourTest&lt;/b&gt; class may have;
1) A single static method with a &lt;b&gt;@BeforeTest&lt;/b&gt; Annotation
which will run before the class is constructed.
2) A optional override of the &lt;b&gt;beforeExhibits()&lt;/b&gt; method.
3) Additinal methods with &lt;b&gt;@Exhibit&lt;/b&gt; Annotations.
4) A optinal override of the &lt;b&gt;afterExhibits()&lt;/b&gt; method.
5) A single static method with a &lt;b&gt;@AfterTest&lt;/b&gt; Annotation

</text>
      </text>
      <color reference="286"/>
    </NoteNode>
    <NoteNode id="292">
      <children id="293"/>
      <location class="Point2D.Double" id="294" x="560.0" y="920.0"/>
      <id id="295" value="8dbfbb14-22fa-4ac7-b91a-45d469f6c60b"/>
      <revision>1</revision>
      <backgroundColor class="javax.swing.plaf.ColorUIResource" reference="9"/>
      <borderColor class="javax.swing.plaf.ColorUIResource" reference="10"/>
      <textColor class="javax.swing.plaf.ColorUIResource" reference="10"/>
      <text id="296" justification="0" size="4" underlined="false">
        <text>For users of JUnit4 
who are migrating a 
&lt;b&gt;@Exhibit&lt;/b&gt; org.adligo.jtests
annotation is just like a 
&lt;b&gt;@Test&lt;/b&gt; org.junit.Test 
annotation.
&lt;/b&gt;
The Exhibit name was chosen
to distingush between TestClasses
and TestMethods, which can get a 
little ambigious in the junit codebase.</text>
      </text>
      <color reference="286"/>
    </NoteNode>
